import React, {useState} from 'react'

const Welcome = (props) => {
    const [status, setStatus] = useState(false)
    return(
        status ? (
            <>
            <h1>Hello {props.name}</h1>
            </> 
        ):(
            <>
            <h1>Hello World!</h1>
            </> 
        )
    )
}

export default Welcome
